      <div className="container ">
        <h2 className="text-white">We love new friends!</h2>
        <div className="row">
          <div className="col-4">
            <Cards />
          </div>
          <div className="col-4">
            <Cards />
          </div>
          <div className="col-4">

          </div>
        </div>
      </div>
    </section>
  );
};

export default CardSection;
